script: |
  super -f text -I q1963.spq | sort > q1963.out

inputs:
  - name: q1963.spq
    data: |
      SELECT + 92 AS col2 FROM tab1 (FORMAT parquet) AS cor0 WHERE + ( - - col0 ) + + - col2 * 32 + + 66 IS NOT NULL;
  - name: tab1

outputs:
  - name: q1963.out
    data: |
      92
      92
      92
